import React from 'react';

function Gif({title, id, url}){
  return (
    <div style={style} className="col-lg-3 col-md-6 col-sm-12">
      <a href={url} target="_blank" rel="noopener noreferrer" className="text-center">
        <img src={url} alt={title} className="img-fluid" />
      </a>
    </div>

  )
}

const style = {
  display: 'inline-block',
  margin: '0px',
  padding: '0px'
}
const img = {
  width: '100px',
  maxWidth: '150px',
  heigth: '100px'
}
export default Gif;
